import React, { useState} from 'react';
import Box from '@mui/material/Box';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import ListItemText from '@mui/material/ListItemText';
import LunchDiningIcon from '@mui/icons-material/LunchDining';
import NotificationsPausedIcon from '@mui/icons-material/NotificationsPaused';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

function MenuMUI () {

 const [anchorFood, setOpenFood] = useState(null);
 const [anchorSleep, setOpenSleep] = useState(null);

 const foodOpen = (e) => {
  setOpenFood(e.currentTarget);
 };

 const sleepOpen = (e) => {
  setOpenSleep(e.currentTarget);
 };

 const menuClose = () => {
    setOpenFood(null);
    setOpenSleep(null);
 }
  

const food =
<Menu
  anchorEl={ anchorFood }
  open={ Boolean(anchorFood) }
  onClose={ menuClose }
>
  <MenuItem onClick={ menuClose }>
    <ListItemText primary='Ruokalista' />
  </MenuItem>
  <MenuItem onClick={ menuClose }>
    <ListItemText primary='Lis채채 ruoka' />
    </MenuItem>
</Menu>;

  const sleep =
    <Menu
      anchorEl={ anchorSleep }
      open={ Boolean(anchorSleep) }
      onClose={ menuClose }
    >
      <MenuItem onClick={ menuClose }>
        <ListItemText primary='Unilista' />
      </MenuItem>
      <MenuItem onClick={ menuClose }>
        <ListItemText primary='Lis채채 uni' />
        </MenuItem>
    </Menu>;

  return (
    <Box>
      <AppBar position='static'>
        <Toolbar>

          <IconButton onClick={ foodOpen } color='inherit'>
          <LunchDiningIcon /> 
          </IconButton>
          <Button onClick={ foodOpen } variant="outlined" color='inherit'><LunchDiningIcon /> Outlined</Button>
          { food }


          <IconButton onClick={ sleepOpen } color='inherit'>
            <NotificationsPausedIcon />
          </IconButton>
          { sleep }

          <Typography variant='h5' sx={ {flexGrow: 1, textAlign: 'center'} }> moi </Typography>
          
        </Toolbar>
      </AppBar>
    </Box>
  );
}

export default  MenuMUI;
